import React, { Component } from 'react';
import F1InfoAPI from "../../API/InfoAPI";
import Select from 'react-select';


class SelectSceleton extends Component<any> {
    state = {
        selectedOption: null,
    };

    render() {
        async function fetchData(){
            const options = new F1InfoAPI()
            const result: any[] = await options.Drivers("f1/info/drivers")
            return result
        }
        const { selectedOption } = this.state;

        console.log("Options", fetchData())
        return (
            <Select
                value={selectedOption}
                //onChange={this.handleChange}
               // options={options}
            />
        );
    }
}

export default SelectSceleton;
